    opening_index = INF
    len_s = len(s)

    for i in range(len_s):
        if s[i] == "[":
            opening_index = i
            break

    if opening_index == INF:
        print(-1)
        return

    j = opening_index
    while j < len_s and s[j] != "]":
        j += 1

    closing_index, colon_count, pipe_count = INF, 0, 0
    for i in range(opening_index+1, j):
        if s[i] == ":":
            colon_count += 1
        elif s[i] == "|":
            pipe_count += 1
    for i in range(j+1, len_s):
        if s[i]=="]":
            closing_index = i
            break

    if closing_index == INF or colon_count < 2 or pipe_count < 1:
        print(-1)
        return

    max_accordion_length = 4 + colon_length + pipe_length]
