def solve():
    from collections import deque

    n, k = map(int, input().split())
    main_courses = list(map(int, input().split()))

    courses = [[] for _ in range(n)]
    in_degrees = [0] * n

    for i in range(n):
        dependencies = list(map(int, input().split()))[1:]
        for dependency in dependencies:
            courses[i].append(dependency - 1)
            in_degrees[dependency - 1] += 1

    queue = deque()
    order = []

    for main_course in main_courses:
        queue.append(main_course - 1)

    while queue:
        curr_course = queue.popleft()
        order.append(curr_course)

        for dependent_course in courses[curr_course]:
            in_degrees[dependent_course] -= 1
            if in_degrees[dependent_course] == 0:
                queue.append(dependent_course)

    if len(order) == n:
        print(len(order))
        for course in order:
            print(course + 1, end=' ')
    else:
        print(-1)

solve()

