    def permutate(curr_perm, digits_left, target_value):
        if len(curr_perm) == len(str(target_value)):
            curr_perm_num = int("".join(curr_perm))
            if curr_perm_num <= target_value:
                return curr_perm_num

        for digit in digits_left:
            if frequences[digit] == 0:
                continue

            curr_perm.append(digit)
            frequences[digit] -= 1

            result = permutate(curr_perm, digits_left, target_value)
            if result is not None:
                return result

            frequences[digit] += 1
            curr_perm.pop()

        return None

