# Function for determining the number of completely full glasses after pouring champagne for certain seconds
def solve():
    n, t = map(int, input().split())

    levels = [0] * (n * (n + 1) // 2)
    levels[0] = min(levels[0], t)
    for i in range(1, n):
        for j in range(i):
            flowed = max(0, (levels[i * (i - 1) // 2 + j] - 1) / 2)
            levels[i * (i + 1) // 2 + j] += flowed
            levels[i * (i + 1) // 2 + j + 1] += flowed
            if flowed > 0:
                levels[i * (i - 1) // 2 + j] = 1
    return sum(glass >= 1 for glass in levels)

solve()

