def bounce_direction(x, y, vx, vy, n, m):
    while True:
        min_dist_y = min(y, m-y)
        min_dist_x = min(x, n-x)
        min_dist = min(min_dist_x, min_dist_y)

        if min_dist == y and vy == 1:
            y = m
            vy = -vy

        if min_dist == n-x and vx == 1:
            x = n
            vx = -vx

        if min_dist == x and vx == -1:
            x = 0
            vx = -vx

        if min_dist == y and vy == 1:
            y = m
            vy == -vy

        steps_y = n // abs(vy)
        steps_x = m // abs(vx)

        common_steps = min(steps_y, steps_x)

        x += vx * common_steps
        y += vy * common_steps

        if x == n or x == 0 or y == m or y == 0:
            return x, y if x != 0 else (0, y) if y != 0 else (x, 0)

