def check_dividable(n, arr):
    def find_dividable(arr, total_sum):
        left_sum = 0
        for i in range(len(arr)-1):
            left_sum += arr[i]
            if left_sum == total_sum - left_sum:
                return True
        return False

    total_sum = sum(arr)
    if total_sum % 2 != 0:
        return "NO"

    if find_dividable(arr, total_sum):
        return "YES"

    for i in range(n):
        if 2 * arr[i] == total_sum: # If element itself represents half of the total sum
            return "YES"

    return "NO"

