import math

def solve():
    # Input
    N, K = map(int, input().split())
    A = list(map(int, input().split()))

    # Update A to get the maximum divisor
    gcd_val = A[0]
    for elem in A[1:]:
        gcd_val = math.gcd(gcd_val, elem)

    # Calculate maximum divisor
    max_divisor = 1
    if gcd_val <= 1000:
        min_val = max(1, gcd_val - K)
        while gcd_val % min_val != 0:
            min_val += 1
        max_divisor = min(gcd_val, min_val + K)
    else:
        sqrt_val = int(math.sqrt(gcd_val))
        factors = []
        for i in range(1, sqrt_val + 1):
            if gcd_val % i == 0:
                factors.extend([i, gcd_val/i])
        factors.sort(reverse=True)
        for factor in factors:
            if max(min(factor, gcd_val-factor)+K, 1) <= gcd_val:
                max_divisor = max(factor, max_divisor)
                break

    return max_divisor

solve()

