from collections import Counter

def solve():
    MOD = 10**9 + 7

    def factorize(n):
        factors = Counter()
        for i in range(1, int(n ** 0.5) + 1):
            if n % i == 0:
                factors[i] += 1
                if i * i != n:
                    factors[n // i] += 1
        return factors

    def permutation_count(n):
        count = 0
        for i in range(1, n + 1):
            factors = factorize(i)
            current_gcd = 0
            for factor, amount in factors.items():
                count += (factor - current_gcd) * pow(n - i + 1, amount, MOD)
                current_gcd = factor
                count %= MOD
        return count

    n = int(input())

    print(permutation_count(n))

