from itertools import product

def solve():
    n, m = map(int, input().split())

    points = list(product(range(n+1), range(m+1))

    def dist(p1, p2):
        return (p1[0]-p2[0])**2 + (p1[1]-p2[1])**2

    quad_length = 0
    quad_points = None

    for p1, p2, p3, p4 in product(points, repeat=4):
        if len(set([p1, p2, p3, p4])) == 4:
            poly_length = dist(p1, p2) + dist(p2, p3) + dist(p3, p4)
            if poly_length > quad_length:
                quad_length = poly_length
                quad_points = (p1, p2, p3, p4)

    for p in quad_points:
        print(p[0], p[1])

