def solve():
    import heapq

    n, m, k = map(int, input().split())
    special_vertices = set(map(int, input().split()))

    graph = {i: [] for i in range(1, n+1)}

    for _ in range(m):
        u, v, w = map(int, input().split())
        graph[u].append((v, w))
        graph[v].append((u, w))

    dist = {v: float('inf') for v in range(1, n+1)}

    for v in special_vertices:
        dist[v] = 0
        queue = [(0, v)]

        while queue:
            d, node = heapq.heappop(queue)

            if d > dist[node]:
                continue

            for neighbor, weight in graph[node]:
                new_dist = max(d, weight)

                if new_dist < dist[neighbor]:
                    dist[neighbor] = new_dist
                    heapq.heappush(queue, (new_dist, neighbor))

    result = []
    for v in special_vertices:
        farthest_dist = max(dist[x] for x in special_vertices if x != v)
        result.append(farthest_dist)

    print(" ".join(str(v) for v in result))

