def solve():
    N, M = map(int, input().split())
    weight = list(map(int, input().split()))
    parts = [list(map(int, input().split())) for _ in range(M)]

    def check_distance_order(order):
        for order_perm in permutations(order):
            prev_end = order_perm[0] + order_perm[1]
            for i in range(1, N - 1):
                new_start = prev_end
                new_end = new_start + order_perm[i + 1]
                if not all(sum(weight[j] for j in range(start + 1, end) if between_parts(parts, start, end, j)) <= weight_limit
                           for start, end, weight_limit in parts):
                    break
                prev_end = new_end
            else:
                return prev_end - order_perm[N - 1]
        return -1

    def between_parts(parts, start, end, camel_idx):
        for part_start, part_end, _ in parts:
            if part_start <= camel_idx < part_end:
                return True
        return False

    orders = permutations(range(N))

    min_distance = float('inf')
    for order in orders:
        min_distance = min(min_distance, check_distance_order(order))

    print(min_distance)

