    import math

    def nodes_visited(h, n, curr_node=1, dest_node=1, skipped_commands=0):
        if h == 0:
            return 0

        half_nodes = 2**(h-1)
        children_dist = half_nodes / 2  # considering tree is balanced

        if n < dest_node or n >= dest_node + half_nodes:
            move_to = curr_node - children_dist
        else:
            move_to = curr_node + children_dist

        if move_to == n:
            return 0

        if skipped_commands == 2:
            return 1 + nodes_visited(h-1, n, move_to, 1, 0)

        skipped_commands = 0 if move_to != dest_node else skipped_commands + 1

        return 1 + nodes_visited(h-1, n, move_to, dest_node, skipped_commands)

    h, n = map(int, input().split())

    return nodes_visited(h, n)

solve()

