    a, b = map(int, input().split())
    heights = list(map(int, input().split()))

    unattractiveness = 0
    for i in range(n - 1):
        diff = abs(heights[i] - heights[i+1])
        unattractiveness += diff

    if a + b < n:
        return -1

    min_unattractiveness = 0
    min_unattractiveness += abs(heights[0] - heights[1]) if n > 1 else 0
    if n > 1:
        for i in range(1, n - 1):
            if (min(heights[i - 1], heights[i], heights[i + 1]) == heights[i] and b > 0) or a == 0:
                min_unattractiveness += abs(heights[i] - heights[i + 1])
                b -= heights[i]
            else:
                min_unattractiveness += abs(heights[i] - heights[i + 1])
                a -= heights[i]
        min_unattractiveness += abs(heights[-1] - heights[-2]) if n > 1 else 0

    return min_unattractiveness

